import React from "react";


function soicItems(props) {

    return (
        <li className="list-group-item">
            <img src={props.img}alt="image"/>
        <input id = {props.media} type ="checkbox"/>
        <label for ={props.media}>{props.media}</label>
    </li>

    )
    
};

export default soicItems
